import axios from 'axios';

const endpoint = `${process.env.REACT_APP_SERVER_SERVICE}/api/friends`;

export const getFriends = async (token) => {
    try {
        let res = await axios.get(`${endpoint}`, {
            headers: {
                Authorization: token
            }
        });
        return res.data;
    } catch (err) {
        console.log(err);
    }
}
